syntax = "proto3";
package gSMFRETda.pb;

message p_ga {   
    string idx = 1;
    int32 start = 2;
    int32 stop = 3;
    repeated float params = 4 [packed=true];
}

message p_n {    
    int32 s_n = 1;
}

message p_cap {    
    string idx = 1;
    int32 cap = 2;    
}

message res {    
    repeated float elist = 1 [packed=true];
}